func (s CronSet) Write(data m.CronData) bool {
	res := s.Collection().Call("Write", data)
	resTyped, _ := res.(bool)
	return resTyped
}

// Aggregates returns the result of this RecordSet query, which must by a grouped query.
func m_Cron_Aggregates(rs CronSet, fieldNames ...models.FieldName) []m.CronGroupAggregateRow {
	lines := rs.RecordCollection.Aggregates(fieldNames...)
	res := make([]m.CronGroupAggregateRow, len(lines))
	for i, l := range lines {
		res[i] = CronGroupAggregateRow{
			values: l.Values.Wrap().(m.CronData),
			count:  l.Count,
			condition: q.CronCondition{
				Condition: l.Condition,
			},
		}
	}
	return res
}

